ab Bd 4: Leben und Wunderns-würdige Begebenheiten des Cardinals Julii Alberoni, degradirten Anjouistischen Premier-Ministers. - Bd. 3 in Frankfurt und Leipzig, Bd. 6 in Hamburg, Frankfurt und Leipzig erschienen

Übersetzung ins Italienische: La storia del cardinale Alberoni, dalla sua nascita fino al principio dell'anno 1719. Del signor J.R. Tradotta dallo spagnuolo; Den Haag: Adriano Moetjens, 1719; 
Istoria del cardinal Alberoni dal giorno della sua nascita fino a' principj del 1719. Scritta in spagnuolo, ed ultimamente tradotta dal francese con aggiunta di quanto e seguito dino a' 22 marzo del 1720; Amsterdam: Ipigeo Lucas, 1720

Titel der italienischen Übersetzung: Mistica citta di Dio miracolo della sua onnipotenza, & abbisso della grazia. Istoria divina, e vita della vergine madre di Dio, regina, e signora nostra Maria santissima riparatrice della colpa d'Eva, e midiatrice della grazia ... Dedicata al gloriossimo patriarca San Giuseppe sposo purissimo dell'Immacolata vergine Nostra Signora, Palermo: Gio. Battista d'Aiccardo, 1703;
Zweite Ausgabe: Milano: Marco Antonio Pandolfo Malatesta - Tomos I,II,IV - Trento: Giovanni Parone, Tomos III,V - 1709 (wahrscheinlich Vorlage der deutschen Übersetzung)
dritte u.vierte Ausgabe: Trento: Giovanni Parone, 1713 bzw.1714.

